script: |
  super -f text -I q1368.spq | sort > q1368.out

inputs:
  - name: q1368.spq
    data: |
      SELECT d-e,
      a,
      b
      FROM t1 (FORMAT parquet)
      WHERE (e>a AND e<b)
      AND d NOT BETWEEN 110 AND 150;
  - name: t1

outputs:
  - name: q1368.out
    data: |
      -2	191	194
      1	220	223
      2	245	249
